import React from 'react';
import './General.css';

function General() {
    return (
        <div>
            <button className="buttonAdd">
                <span className="icon">
                <i class="fa-solid fa-plus"alt="Add Icon"></i>
                </span>
            </button>
        </div>
    );
}

export default General;
